const VertexShaderDesc* VertexShaderDesc::GetDesc(ShaderDesc::ShaderType shader, ShaderDesc::ShaderVersion ver)
{
    return Descs[GetShaderIndex(shader, ver)];
};

VertexShaderDesc::ShaderIndex VertexShaderDesc::GetShaderIndex(ShaderDesc::ShaderType shader, ShaderDesc::ShaderVersion ver)
{
    ShaderDesc::ShaderIndex index = ShaderDesc::GetShaderIndex(shader);
    return ShaderIndexingData[index][ver]. VertexIndex;
};

VertexShaderDesc::ShaderIndex VertexShaderDesc::GetShaderIndexForComboIndex(unsigned index, ShaderDesc::ShaderVersion ver) 
{
    switch(ver)
    {
        case ShaderDesc::ShaderVersion_D3D1xFL91:
        {
            SF_UNUSED(index);
            SF_DEBUG_ASSERT(1, "D3D1xFL91 indicated that ShaderCombo information was not required.");
            return VSI_None;
        }
        case ShaderDesc::ShaderVersion_D3D1xFL93:
        {
            SF_UNUSED(index);
            SF_DEBUG_ASSERT(1, "D3D1xFL93 indicated that ShaderCombo information was not required.");
            return VSI_None;
        }
        case ShaderDesc::ShaderVersion_D3D1xFL10X:
        {
            SF_UNUSED(index);
            SF_DEBUG_ASSERT(1, "D3D1xFL10X indicated that ShaderCombo information was not required.");
            return VSI_None;
        }
        case ShaderDesc::ShaderVersion_D3D1xFL11X:
        {
            SF_UNUSED(index);
            SF_DEBUG_ASSERT(1, "D3D1xFL11X indicated that ShaderCombo information was not required.");
            return VSI_None;
        }
        default: SF_ASSERT(0); return VSI_None;
    }
}

unsigned VertexShaderDesc::GetShaderComboIndex(ShaderDesc::ShaderType shader, ShaderDesc::ShaderVersion ver)
{
    switch(ver)
    {
        case ShaderDesc::ShaderVersion_D3D1xFL91:
        {
            SF_UNUSED(shader);
            SF_DEBUG_ASSERT(1, "D3D1xFL91 indicated that ShaderCombo information was not required.");
            return 0;
        }
        case ShaderDesc::ShaderVersion_D3D1xFL93:
        {
            SF_UNUSED(shader);
            SF_DEBUG_ASSERT(1, "D3D1xFL93 indicated that ShaderCombo information was not required.");
            return 0;
        }
        case ShaderDesc::ShaderVersion_D3D1xFL10X:
        {
            SF_UNUSED(shader);
            SF_DEBUG_ASSERT(1, "D3D1xFL10X indicated that ShaderCombo information was not required.");
            return 0;
        }
        case ShaderDesc::ShaderVersion_D3D1xFL11X:
        {
            SF_UNUSED(shader);
            SF_DEBUG_ASSERT(1, "D3D1xFL11X indicated that ShaderCombo information was not required.");
            return 0;
        }
        default: SF_ASSERT(0); return 0;
    }
}

